import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Avatar from './components/Avatar.js';

class App extends Component {
  constructor () {
    super();

    this.state = {
      avatars: [
        {
          url: ""
        },
        {
          url: ""
        },
        {
          url: ""
        },
      ]
    }
  }

  render () {
    const avatars = this.state.avatars.map((avatar, i) => {
      return <p key={i}><Avatar url={avatar.url} /></p>
    });


    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {avatars}
          </p>
          {/* <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          > */}
          {/* </a> */}
        </header>
      </div>
    );
  }
}

export default App;
